import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { ToastContainer } from 'react-toastify';

ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <App />
    <ToastContainer 
        autoClose={2000}
        pauseOnHover={false}
        closeOnClick={false}
        pauseOnFocusLoss={false}
        draggable={false}
      />
  </React.StrictMode>
);
